(1, 'active', 'Le 8 novembre 1895, Wilhelm Röntgen découvre le rayon X.', '2021-11-08', 3, 'Les rayons X sont une forme de rayonnement électromagnétique à haute fréquence constitué de photons dont l\'énergie varie d\'une centaine d\'eV (électron-volt), à plusieurs MeV1.\r\n\r\nCe rayonnement a été découvert en 1895 par le physicien allemand Wilhelm Röntgen, qui a reçu pour cela le premier prix Nobel de physique ; il lui donna le nom habituel de l\'inconnue en mathématiques, X. Il est naturel (cosmologie, astronomie) ou artificiel (radiologie) et alors résulte du bombardement d\'électrons sur une cible généralement en tungstène. La principale propriété des rayons X est de traverser la matière en étant partiellement absorbés en fonction de la densité de celle-ci et de l\'énergie du rayonnement, ce qui permet d\'avoir une information sur l\'intérieur des objets qu\'ils traversent.', 'https://fr.wikipedia.org/wiki/Rayon_X https://fr.wikipedia.org/wiki/Wilhelm_R%C3%B6ntgen', 1, '2021-11-07', 0, 0, 1, );

